type: object
required:
  - created_at
  - created_by
  - updated_at
  - updated_by
properties:
  created_at:
    type: string
    format: date-time
    readOnly: true
    example: '2020-01-18T14:26:26.000Z'
  created_by:
    type: integer
    readOnly: true
  updated_at:
    type: string
    readOnly: true
    format: date-time
    example: '2020-01-19T15:43:35.000Z'
  updated_by:
    type: integer
    readOnly: true
  version:
    type: integer
    nullable: true
